import React from "react";
import { Search } from "./Search";
import { Categories } from "./Categories";

export const MainPage = () => {
  return (
    <div className="w-full bg-sky-100 px-16 py-10 flex gap-10">
      <div className="w-3/4">
        <Search />
        <Categories />
      </div>
      <div className="1/4 bg-white">Hi</div>
    </div>
  );
};
